"description": "维吾尔语，简称维语，是一种突厥语族语言。为大多数维吾尔族的母语，有1000万到1500万使用者，是中华人民共和国新疆维吾尔自治区法定的官方语言之一。维吾尔语的使用者主要集中于中国新疆，中亚的哈萨克斯坦、吉尔吉斯斯坦和乌兹别克斯坦也有维吾尔语分布，其他许多国家亦有维吾尔语移民社区。维吾尔文是维吾尔族使用的语言，属于突厥语系。它使用阿拉伯字母书写，并有一些特殊的符号和标记。维吾尔文的语法结构与土耳其语、哈萨克语等突厥语族语言相似，但也有一些独特的特点。例如，它的动词通常位于句子的末尾，而主语则在动词之前。此外，维吾尔文还使用一些特殊的后缀来表示时态、语气和人称等。维吾尔文在新疆维吾尔自治区广泛使用，也是中国官方承认的少数民族语言之一。除了口语交流外，维吾尔文还用于书面文学、新闻报道、政治宣传等方面。",
"labels": ["ئۇيغۇر تىلى","维吾尔文","维吾尔语","维吾尔族","维吾尔","文字","语言","鲁虺书库","语言翻译","翻译","语言文字"],
