"description": "满语是满族使用的语言，属于阿尔泰语系满-通古斯语族满语支。满文是1599年清太祖命额尔德尼和噶盖借用蒙古字母创制的文字，最初只有女真字，后逐渐加圈点改为新满文。满语和满文在清朝时期曾经是中国的官方语言和文字，但随着清朝的衰落和汉族文化的渗透，满语和满文逐渐失传。目前，只有少数满族人能够流利地使用满语，而满文则已经成为了一种死文字。满文父系统： 原始迦南字母 > 腓尼基字母 > 阿拉米文 > 叙利亚文 > 粟特文 > 回鹘文 > 蒙古文 > 满文。",
