"title": "其他和其它",
"image": "http://mini.s-shot.ru/1024x768/400/jpeg/?http://book.luhui.net",
"description": "“其他”和“其它”这两个词在汉语中均有代指其余的人、事或物的含义，但二者之间存在一些微妙的差别。首先，从概念上来看，“其他”可以用来代指所有的人、事或物，而“其它”则仅用来代指除人以外的事或物。其次，从书写规范的角度来看，“其他”被认为是标准用法，常见于日常以及规范的书面文件中；相较之下，“其它”更多地出现在日常用法中。然而，值得注意的是，尽管“其他”与“其它”在某些情况下不能互换使用，但其实它们的指代范围是相近的，能用“其它”的场合大多也能用“其他”，反之亦然。",
